### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. **Functions and Their Properties**
- **Differentiability and Continuity**:
  - Conditions for differentiability and continuity at a point.
  - Example: \( f(x) = a \sin|x| + b e^{|x|} \) is differentiable at \( x = 0 \) if and only if \( a + b = 0 \).

- **Limits**:
  - Evaluation of limits, especially as \( x \) approaches a certain value.
  - Example: \( \lim_{x \to 0} \left( \frac{(1+x)^{\frac{1}{x}} - (1-x)^{\frac{1}{x}}}{x} \right) \).

- **Function Composition**:
  - Domain and range of composite functions.
  - Example: \( (g \circ f \circ g \circ f)(2) \).

#### 2. **Types of Functions**
- **One-to-One Functions**:
  - Identification and properties of one-to-one (injective) functions.
  - Examples: \( f(x) = -5x - 1 \), \( f(x) = \log_{5x} \).

- **Quadratic and Polynomial Functions**:
  - Solving quadratic equations and understanding their roots.
  - Example: \( e^{2x} - 9e^x = -18 \) transformed into \( y^2 - 9y + 18 = 0 \).

#### 3. **Sequences and Series**
- **Limits of Sequences**:
  - Finding the limit of sequences as \( n \) approaches infinity.
  - Example: \( a_n = \frac{27n^7 + 25n^5 + 2n^8 + n}{4n^2 + 2n + 10n^3 + 5n^4 + n} \).

#### 4. **Logarithmic and Exponential Functions**
- **Properties and Equations**:
  - Solving logarithmic and exponential equations.
  - Example: \( \log_{2}(x+1) - \log_{4}(x-3) = 2 \).

#### 5. **Domain and Range**
- **Domain of Functions**:
  - Determining the domain of functions, especially composite functions.
  - Example: Domain of \( g \circ f \) where \( f(x) = \sqrt{x+5} \) and \( g(x) = x^2 - 5 \).

#### 6. **Differentiability and Tangents**
- **Tangent Lines**:
  - Finding the equation of the tangent line to a function at a given point.
  - Example: Tangent of \( f(x) = x \sqrt{25 - x^2} \) at \( x = 3 \).

